#!/usr/bin/env node
/* eslint-disable */

const Parser = require('./dist/mercury');
const package_info = require('./package.json');
const argv = require('yargs-parser')(process.argv.slice(2));

const {
  _: [url],
  format,
  f,
  extend,
  e,
  extendList,
  l,
  header,
  h,
  addExtractor,
  x,
  version,
} = argv;
(async (
  urlToParse,
  contentType,
  extendedTypes,
  extendedListTypes,
  headers,
  addExtractor,
  version
) => {
  if (version) {
    console.log(package_info.version);
    process.exit(0);
  }

  if (!urlToParse) {
    console.log(
      '\n\
postlight-parser\n\n\
    The Postlight Parser extracts semantic content from any url\n\n\
Usage:\n\
\n\
    $ postlight-parser url-to-parse [--format=html|text|markdown] [--header.name=value]... [--extend type=selector]... [--extend-list type=selector]... [--add-extractor path_to_extractor.js]... \n\
\n\
'
    );
    return;
  }
  try {
    const contentTypeMap = {
      html: 'html',
      markdown: 'markdown',
      md: 'markdown',
      text: 'text',
      txt: 'text',
    };

    const extensions = {};
    [].concat(extendedTypes || []).forEach(t => {
      const [name, selector] = t.split('=');
      const fullSelector =
        selector.indexOf('|') > 0 ? selector.split('|') : selector;
      extensions[name] = { selectors: [fullSelector] };
    });
    [].concat(extendedListTypes || []).forEach(t => {
      const [name, selector] = t.split('=');
      const fullSelector =
        selector.indexOf('|') > 0 ? selector.split('|') : selector;
      extensions[name] = {
        selectors: [fullSelector],
        allowMultiple: true,
      };
    });

    // Attempt to load custom extractor from path.
    let customExtractor;
    if (addExtractor) {
      customExtractor = require(addExtractor);
    }

    const result = await Parser.parse(urlToParse, {
      contentType: contentTypeMap[contentType],
      extend: extensions,
      headers,
      customExtractor,
    });
    console.log(JSON.stringify(result, null, 2));
  } catch (e) {
    if (e.message === 'ETIMEDOUT' && false) {
      console.error(
        '\nPostlight Parser encountered a timeout trying to load that resource.'
      );
    } else {
      console.error(
        '\nPostlight Parser encountered a problem trying to parse that resource.\n'
      );
      console.error(e);
    }
    const reportBug =
      'If you believe this was an error, please file an issue at:\n\n    https://github.com/postlight/parser/issues/new';
    console.error(`\n${reportBug}\n`);
    process.exit(1);
  }
})(
  url,
  format || f,
  extend || e,
  extendList || l,
  header || h,
  addExtractor || x
);

module.exports = function (config) {
  config.set({

    basePath: '',

    frameworks: ['jasmine', 'browserify'],
    files: [
      { pattern: 'src/**/*.test.js', included: true },
    ],

    exclude: [],

    preprocessors: {
      'src/**/*.js': ['browserify'],
    },

    browserify: {
      debug: true,
      transform: ['babelify', 'brfs'],
    },

    reporters: ['progress'],
    port: 9876,
    colors: true,
    logLevel: config.LOG_INFO,
    autoWatch: false,
    browsers: ['Chrome'],
    singleRun: true,
    concurrency: Infinity,
  });
};

#!/usr/bin/env node
var fs = require('fs')
var execSync = require('child_process').execSync

var optRe = /^--/
var args = process.argv.slice(2).reduce((acc, arg) => {
  if (optRe.test(arg)) {
    acc.opts.push(arg)
  } else {
    acc.urls.push(arg)
  }

  return acc
}, { opts: [], urls: [] })

var urls = args.urls

if (!args.opts.find(arg => arg === '--no-rebuild')) {
  console.log('Rebuilding Mercury')
  execSync('MERCURY_TEST_BUILD=true npm run build')
}

var Mercury = require('./dist/mercury_test')

console.log(`Fetching link(s)`)

urls.map(url => {
  Mercury.parse(url, { fallback: false }).then(function(result) {
    var htmlFile = './preview.html'
    var jsonFile = './preview.json'

    var html = `<h1>${result.title}</h1>${result.content}`

    fs.writeFileSync(htmlFile, html)
    fs.writeFileSync(jsonFile, JSON.stringify(result))
    execSync(`open ${jsonFile}`)
    execSync(`open ${htmlFile}`)
  })
})

import nodeResolve from 'rollup-plugin-node-resolve';
import globals from 'rollup-plugin-node-globals';
import { terser } from 'rollup-plugin-terser'; // eslint-disable-line import/extensions
import babel from 'rollup-plugin-babel';
import commonjs from 'rollup-plugin-commonjs';

export default {
  input: 'src/mercury.js',
  plugins: [
    babel({
      runtimeHelpers: true,
      exclude: './node_modules#<{(|*',
    }),
    commonjs({
      ignoreGlobal: true,
    }),
    globals(),
    nodeResolve({
      browser: true,
      preferBuiltins: false,
    }),
    terser(),
  ],
  treeshake: true,
  output: {
    file: process.env.MERCURY_TEST_BUILD
      ? 'dist/mercury_test.esm.js'
      : 'dist/mercury.esm.js',
    format: 'es',
    sourcemap: true,
  },
};

